// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import Home from './components/Home'; // 홈 컴포넌트
import Action from './components/Action'; // 액션 페이지
import Fear from './components/Fear'; // 공포 페이지
import Puzzle from './components/Puzzle'; // 퍼즐 페이지
import RPG from './components/RPG'; // RPG 페이지
import Sports from './components/Sports'; // 스포츠 페이지
import Simulation from './components/Simulation'; // 시뮬레이션 페이지
import FPS from './components/FPS'; // FPS 페이지

const App = () => {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/action" element={<Action />} />
        <Route path="/fear" element={<Fear />} />
        <Route path="/puzzle" element={<Puzzle />} />
        <Route path="/rpg" element={<RPG />} />
        <Route path="/sports" element={<Sports />} />
        <Route path="/simulation" element={<Simulation />} />
        <Route path="/fps" element={<FPS />} />
      </Routes>
      <Footer />
    </Router>
  );
};

export default App;
